sys_variable_value.value:
(function execute(inputs, outputs) {
  var body = JSON.parse(inputs.body);
  outputs.groups = [];
  for (var i = 0; i < body.length; i++) {
    outputs.groups[i] = {};
    outputs.groups[i]["name"] = body[i].name;
    outputs.groups[i]["uri"] = body[i].uri;
  }
})(inputs, outputs);

